&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;El tiempo de garant&iacute;a de todos nuestros productos, es de 30 d&iacute;as, y solo se hace efectiva por defectos de fabricaci&oacute;n, NO se recibe como garant&iacute;a da&ntilde;os por mala manipulaci&oacute;n, es decir si el producto se encuentra con golpes, muestras de mal uso o que se devuelva incompleto, los gastos de env&iacute;os por garant&iacute;as los cubre el cliente. &lt;br&gt;CONDICI&Oacute;N: Que el producto cuente con su caja, empaques, accesorios y factura o documento equivalente y que se encuentre dentro del periodo de garant&iacute;a ofrecido. Adicional, se debe enviar &lt;br&gt;TIEMPO PARA DAR RESPUESTA AL TR&Aacute;MITE: El tiempo establecido por la ley para dar respuesta a la solicitud del tr&aacute;mite de garant&iacute;a es de 30 d&iacute;as h&aacute;biles desde el recibo del producto en el Centro de Servicios Autorizado.&lt;br&gt;PARA TENER EN CUENTA EN EL TR&Aacute;MITE DE GARANT&Iacute;A: El hecho de dar inicio al proceso de garant&iacute;a no implica la aceptaci&oacute;n de la misma, esta estar&aacute; sujeta a la revisi&oacute;n t&eacute;cnica que haga constar que no cabe causal de rechazo. As&iacute; mismo, si el producto cuenta con garant&iacute;a directa del fabricante, el cliente tendr&aacute; que tramitarla directamente con quien este designe para tal fin y estar&aacute; sujeta a sus pol&iacute;ticas y condiciones.&lt;br&gt;GENERALIDADES DEL TR&Aacute;MITE DE GARANT&Iacute;A: &lt;br&gt;En caso de que la garant&iacute;a sea aceptada lo que estipula la ley es lo siguiente:&lt;br&gt;1. Se reparar&aacute; el equipo dentro de los siguientes 30 d&iacute;as h&aacute;biles siguientes a la recepci&oacute;n del mismo.&lt;br&gt;2. El t&eacute;rmino de la garant&iacute;a se suspender&aacute; mientras el consumidor est&eacute; privado del uso del producto.&lt;br&gt;3. Solo si el bien no admite reparaci&oacute;n se proceder&aacute; a su reposici&oacute;n, inicialmente por uno igual, en el caso de que no sea posible, por otro de la misma especie, similares caracter&iacute;sticas o especificaciones t&eacute;cnicas.&lt;br&gt;En caso de que la garant&iacute;a sea rechazada:&lt;br&gt;1. Se notificar&aacute; por escrito el dictamen t&eacute;cnico y las causales de rechazo.&lt;br&gt;2. Se retornar&aacute; el equipo a la direcci&oacute;n registrada en la orden. &lt;br&gt;Incluir excluyentes de garant&iacute;as de cada vendedor si aplican&lt;br&gt;Cambios y Retractos:&lt;br&gt;Si una vez recibido el producto desea cambiarlo o retractarse, puede hacerlo siempre y cuando cumpla con lo siguiente:&lt;br&gt;VIGENCIA: Este tr&aacute;mite se podr&aacute; realizar &uacute;nicamente durante los primeros 5 d&iacute;as h&aacute;biles siguiente al recibo del paquete.&lt;br&gt;CONDICI&Oacute;N: Es indispensable que se garantice la integridad del producto; solo se podr&aacute; iniciar el tr&aacute;mite de cambio o retracto, cuando los productos no presentan rastros de haber sido usados, cuenten con las etiquetas intactas, est&aacute;n en un estado de limpieza impecable y la caja y los accesorios se encuentran en perfecto estado.&lt;br&gt;FLETES: Los costos de los fletes y seguros correr&aacute;n por cuenta del cliente y el embalaje deber&aacute; garantizar que el producto se reciba en perfectas condiciones. Ser&aacute; responsabilidad del comprador tomar las medidas pertinentes para que el producto, incluida su caja, no sufra deterioros en el transporte.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Tiempo de entrega:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;De 3 a 7 d&iacute;as h&aacute;biles una vez el pago este aprobado.&lt;/p&gt;

